import { Axios } from "axios";

function Product() {
  fetch("/api/Domain/Product")
    .then((response) => response.json())
    .then((data) => {
      data.array.forEach((element) => {
        <li>${element.productId}</li>;
      });
    })
    .catch((error) => console.log(error));

  return (
    <div>
      <h1>Products:</h1>
      <ul></ul>
    </div>
  );
}
export default Product;
